  false,\n\t\"url\": null,\n\t\"notes\": \"The data collection project assessed the
  economic performance of Hawaii-based longline vessels that made trips in 2012. Operational
  and vessel costs were collected by personal interviews with vessel owners, captains,
  and crew. Revenue information was generated from the Hawaii Department of Aquatic
  Resources dealer reports and NMFS logbooks (landings and fishing efforts). The project
  estimated the cost-earnings for each individual longline vessels. Cost-earnings
  data were also available for different vessel groups defined by species targeted
  (tuna-targeting only and tuna/swordfish-targeting). \",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
